import { Parallax } from 'react-parallax';

const ParallaxImage = () => (
    <Parallax blur={1} bgImage= "https://images.unsplash.com/reserve/Af0sF2OS5S5gatqrKzVP_Silhoutte.jpg?ixid=MXwxMjA3fDB8MHxzZWFyY2h8M3x8cGljfGVufDB8fDB8&ixlib=rb-1.2.1&w=1000&q=80" bgImageAlt="profile pic" strength={200} >
        <div style={{height: 500}}>
            <h1>hello</h1>
        </div>

    </Parallax>
);

export default ParallaxImage
